INSERT INTO `news` (`UID`, `news_text`, `news_title`, `news_date`, `news_latest`) VALUES
(1, 'Welcome to the first release of Stardust, the project is still very much early in developement, so please bear with me if stuff crashes, or simply doesnt do anything. If you''re brave enough to have come this far, thank you, and hopefully you will witness the birth of Stardust, welcome to the ride. if you have any feedback, please send it to digitale001@gmail.com', 'Stardust Alpha Live', '2012-05-20', 0),
(6, 'The official Stardust website is up, it''s pretty basic at the moment, but be sure to check by for the latest info on Stardust, if you are currently playing the Android version, you can download a desktop version from https://sites.google.com/site/digitaletec/  (this link is also on Google Play) ', 'Stardust Website up', '2012-06-23', 0),
(7, 'You can now create your own personal Stardust account to play with. Basic character creation is also working, allowing you to set the name, race, sex and portrait for your characters.', 'Account and character creation working.', '2012-06-25', 0),
(9, 'Please note it may not be possible to log into Stardust from July 1 to July 3, the security system is being updated, this causes a lot of disruption to the server communications.Thanks for being patient, we will update the news once the work is complete.', 'Security Updates', '2012-07-01', 0),
(11, 'Big client update, get the new client! A very basic chat client, accessible through the pullout menu, now you can chat to other people in game. Multi-player synchronization! you can actually see other players flying in game and blow up their ships! The save account check-box now works, never enter your account details at log-in again!', 'It takes two to tango.', '2012-07-03', 0),
(12, 'All spaceships have been forcefully docked by Galactic LEO as a safety measure. Hostile forces have been seen in the vicinity of Telete III station, posing a risk to local ships, Galactic LEO strongly recommends all pilots dock at friendly space stations when not in command of their ships to prevent loss of life or assets. Telete III Station management are offering bounties for each Hive AI robot destroyed.', 'Sitting on the dock of the bay.', '2012-08-07', 0),
(13, 'Telete III Station Management thanks all pilots for assisting in supressing the Hive AI incursion, our shields are still under attack but hold steady. Pilots now receive salvage rights on all kills, any items recovered from combatant wrecks will be automatically placed in your station warehouse.', 'Telete III Saved by Brave Pilots!', '2012-08-16', 1);
